    box-shadow: 10px 40px 50px rgba(229, 233, 246, 0.4);
    border-radius: 20px;
}
.job-card-title {
    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 24px;
    line-height: 150%;
    /* identical to box height, or 36px */


    /* gray/900 */

    color: #18181B;
}
.job-card-rate {
    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 24px;
    line-height: 24px;
    /* identical to box height, or 100% */

    letter-spacing: -0.5px;

    color: #3F3F46;

}
.job-card-tags {
    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 150%;
    /* identical to box height, or 24px */


    /* gray/700 */

    color: #3F3F46;

}
.job-card-skills {

    background: #EFF0F6;
    border-radius: 7px;
}
.job-card-skills-text {
    font-family: 'Amazon Ember';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 22px;
    /* identical to box height, or 160% */


    color: #1F1F1F;
}
.techsolution-life-text {
    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 700;
    font-size: 45px;
    /* identical to box height, or 124% */


    color: #000000;

    mix-blend-mode: normal;
}
.workspace-work-text {
    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 600;
    font-size: 48px;
    /* or 117% */


    color: #4540DB;

    mix-blend-mode: normal;
}
.workspace-work-rawtext {
    font-family: 'Open Sans';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 35px;
    /* or 219% */


    color: #555555;

    mix-blend-mode: normal;
}
.global-team-title {
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 400;
    font-size: 56px;
    line-height: 66px;
    /* identical to box height */

    text-align: center;
    letter-spacing: -0.02em;
    font-feature-settings: 'ss03' on, 'cv03' on, 'cv04' on, 'cv06' on, 'cv09' on, 'case' on, 'cpsp' on;

    color: #000000;

}

.global-team-box {
    border: 1px solid #E7EAEE;
    border-radius: 16px;
}
.global-team-box-img {
    border-radius: 16px;
}
.global-team-box-title {
    font-family: 'Avenir LT Std';
    font-style: normal;
    font-weight: 550;
    font-size: 24px;
    line-height: 32px;
    /* identical to box height, or 133% */

    letter-spacing: -0.015em;
    font-feature-settings: 'pnum' on, 'lnum' on, 'ss03' on, 'cv03' on, 'cv04' on, 'cv06' on, 'cv09' on, 'case' on, 'cpsp' on;

    /* Neutral/900 */

    color: #07090D;


    /* Inside auto layout */

    flex: none;
    order: 0;
    flex-grow: 0;
}
.global-team-box-subtitle {
    font-family: 'Inter';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    /* identical to box height, or 171% */

    letter-spacing: -0.09px;
    font-feature-settings: 'ss01' on, 'ss03' on, 'cv03' on, 'cv04' on, 'cv06' on, 'cv09' on;

    /* Blue/Base */

    color: #1355FF;


    /* Inside auto layout */

    flex: none;
    order: 2;
    flex-grow: 1;
}
.global-team-box-border {
    border-bottom: 1px solid #E7EAEE;

    /* Inside auto layout */

    flex: none;
    order: 1;
    align-self: stretch;
    flex-grow: 0;
}
.global-team-box-text {
    font-family: 'Inter';
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
    line-height: 28px;
    /* or 175% */

    letter-spacing: -0.18px;
    font-feature-settings: 'ss01' on, 'ss03' on, 'cv03' on, 'cv04' on, 'cv06' on, 'cv09' on;

    /* Neutral/600 */

    color: #586174;


    /* Inside auto layout */

    flex: none;
    order: 2;
    align-self: stretch;
    flex-grow: 0;
}
